import React from "react";
import "../assets/custom.css";

const GetStarted = () => {
  return (
    <>
      <main className="md:pl-12 get-started-bg">
        <div className="flex ">
          <div className="w-full ">
            <br />
            <div className="relative w-11/12 py-12 mb-20 m-auto md:m-0 mt-12 md:mt-0">
              <div className="w-full m-auto mb-6">
                <img
                  src="/img/agile-credit-logo-large.svg"
                  alt=""
                  className="w-1/4 md:w-1/3 m-auto"
                />
              </div>
            </div>
          </div>
        </div>
      </main>
    </>
  );
};
export default GetStarted;
